import React from "react";
import img from '../components/d/img.PNG'

function Navbar() {
    
  return (
    <div className="navbar bg-neutral text-neutral-content">
      <a className="btn btn-ghost normal-case text-xl "> Uni Kinder Garten</a>
      <label tabIndex={0} className="btn btn-ghost btn-circle avatar">
        <div className="w-10 rounded-full">
          {/* <img src="https://images.unsplash.com/photo-1494869042583-f6c911f04b4c?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8M3x8ZXllc3xlbnwwfHwwfHw%3D&auto=format&fit=crop&w=400&q=60" /> */}
        <img  src={img} alt=""/>
        </div>
      </label>
    </div>
  );
}

export default Navbar;
